import React from 'react';
import './Navbar.css'
import { Link } from 'react-router-dom';
import profileIcon from '../Assets/profileIcon.png'; // Ensure the path is correct

const Navbar = ({ isSignedUp, handleSignOut }) => {
    return (
        <nav style={{ padding: '10px', borderBottom: '1px solid #ccc', display: 'flex', justifyContent: 'space-between' }}>
            <div>
                <Link to="/" style={{ marginRight: '15px' }}>Home</Link>
            </div>
            <div>
                {isSignedUp ? (
                    <>
                        <Link to="/account" style={{ marginRight: '15px' }}>
                            <img
                                src={profileIcon}
                                alt="Profile Icon"
                                style={{ width: '30px', height: '30px' }}
                            />
                        </Link>

                        {/* Edit Profile button styled like Sign Out button */}
                        <Link to="/edit-profile">
                            <button style={{ marginRight: '15px' }}>Edit Profile</button>
                        </Link>

                        <button onClick={handleSignOut} style={{ marginLeft: '15px' }}>Sign Out</button>
                    </>
                ) : (
                    <Link to="/signup">Sign Up</Link>
                )}
            </div>
        </nav>
    );
};

export default Navbar;
